import { Link, useLocation } from "react-router-dom";
import "./Header.scss";

export default function Header() {
  return (
    <header className="header">
      <nav className="header__nav">
        <ul className="header__list">
          <li className="header__item">
            <Link to="/">
              <img className="header__logo" src={logo} alt="asgard  logo" />
            </Link>
          </li>
          {/*  If pathname includes warehouses or is equal to "/" root */}
          <li className="header__item">
            <Link
              to="/products"
              className={`header__link ${
                pathname.includes("products") || pathname === "/"
                  ? "header__link--active"
                  : ""
              }`}
            >
              Products
            </Link>
          </li>
          {/* Check to see if pathname includes homepage */}
          <li className="header__item">
            <Link
              to="/homepage"
              className={`header__link ${
                pathname.includes("/homepage") ? "header__link--active" : ""
              }`}
            >
              Home Page
            </Link>
          </li>
        </ul>
      </nav>
    </header>
  );
}
